import React from "react";
import './intro.css';
import me from '../../assets/me.jpg'

function Intro(){
    return(
        <section id="Intro">
            <div className="introcontent">
               <span className="hello">Hello,</span>
               <span>I'm <span className="introName">Akshay </span><br />Web Designer</span>
            </div>
            <img src={me} alt="" />
        </section>
    )
}
export default Intro;
